INSERT INTO `guide_motto` VALUES ('1016557b444d461db917f7008c274661', '奥斯特洛夫斯基', '真正的朋友应该说真话，不管那话多么尖锐。', '励志');
INSERT INTO `guide_motto` VALUES ('39d4c5d45d6941289554fa4a53087f1b', '贝多芬', '我一定要把内心深处的东西释放出来，这就是我作曲的原因。', '励志');
INSERT INTO `guide_motto` VALUES ('3be37ee6c5a745c6bfe586fbefc0699c', '约尔旦', '为自己寻求庸俗乏味的生活的人，才是真正可怜而渺小的。', '励志');
INSERT INTO `guide_motto` VALUES ('3edc2186e4ff4a0fab25e9838ae67423', '培根', '人的威严蕴藏在知识之中，因此，人有许多君主的金银无法买到，君主的武力不可征服内在的东西。', '励志');
INSERT INTO `guide_motto` VALUES ('44e427868f8e4ae49a78e43f2387dbf1', '克雷洛夫', '现实是此岸，理想是彼岸。中间隔着湍急的河流，行动则是架在川上的桥梁。', '励志');
INSERT INTO `guide_motto` VALUES ('4d1409c31f5c448c856507502cd54f00', '爱德华·吉本', '每个人都受两种教育，一种来自别人，另一种更重要的是来自自己。', '励志');
INSERT INTO `guide_motto` VALUES ('571a86c3b5664198994849ff45f440c4', '佚名', '未经开垦的心田犹如那未经开垦的荒地，杂草丛生；而荒地一经开垦，燕以辛勤的汗水浇灌，就会开出绚丽夺目的花朵。', '励志');
INSERT INTO `guide_motto` VALUES ('5f8b7e0664994209ac33e04ec20cfa1f', '加里宁', '无论哪个时代，青年的特点总是怀抱着各种理想和幻想。这并不是什么毛病，而是一种宝贵的品质。', '励志');
INSERT INTO `guide_motto` VALUES ('61e9d57ea7264e18b4cac2f99951de80', '爱迪生', '凡是希望荣誉而舒适地度过晚年的人，他必须在年轻时想到有一天会衰老；这样，在年老时，他也会记得曾有过年轻。', '励志');
INSERT INTO `guide_motto` VALUES ('65e6dcd15d9a439cb4602aa63aca7261', '比尔斯', '灾难——这东西最能经常而确凿无疑地提醒我们，人生的事物并不全是按照我们自己的安排。有两种：自己的背运，还有别人的走运。', '励志');
INSERT INTO `guide_motto` VALUES ('72a89729fc5a4bde95ea2a252d6fa7f1', '道格拉斯·亚当斯', '你在活着的同时，也在学习着，无论如何，你活着。', '励志');
INSERT INTO `guide_motto` VALUES ('8878d4004b6a4c3dbefebfab30fd7457', '贾曦光', '人的聪明和自己的明智及道路的选择，往往在失败以后。', '励志');
INSERT INTO `guide_motto` VALUES ('8c18e723d1b14046ba28d9ad57a82c03', '方孝孺', '不安于小成，然后足以成大器；不诱于小利，然后可以立远功。', '励志');
INSERT INTO `guide_motto` VALUES ('9592eb7d41a44a58a48fe7e0d9665af3', '桑塔耶纳', '我们探求真理，在一切事件中，获得真理是最高的快慰。', '励志');
INSERT INTO `guide_motto` VALUES ('9686deaad2e64cd2bd98ba35201b2848', '佚名', '命运是一个伟大的雕塑家，它举起人生的斧，凿在我们身上敲敲打打。她偏爱那些经过她精雕细刻的人。', '励志');
INSERT INTO `guide_motto` VALUES ('9d2543ebeba44683bdfabc095038c07f', '罗洛·梅', '意志的出现不是对愿望的否定，而是把愿望合并和提升到一个更高的意识水平上。', '励志');
INSERT INTO `guide_motto` VALUES ('aa8c2ccceeb443ada9f983c5a4c50bc8', '享利·凡·戴克', '要对生命感到喜悦，因为它给了你去爱的机会，去工作，去玩乐，并用能仰头看星星的机会。', '励志');
INSERT INTO `guide_motto` VALUES ('b8d622e5e22641c89b1b7647de86e92a', '杨格', '如果迟缓的落日照耀到你的手，而你发觉当天并没有做过有价值的事，那天便应视为已经失落。', '励志');
INSERT INTO `guide_motto` VALUES ('c1f40384c0ce44f88ef48b72ea0f8180', '周国平', '人生最低的境界是平凡，其次是超凡脱俗，最高是返璞归真的平凡。', '励志');
INSERT INTO `guide_motto` VALUES ('c218e9caf9b948ef9148d60bfcea4001', '普希金', '有两种模糊：一种源于思想感情的贫乏，只能用语言来替代思想感情；另一种源于语言的贫乏，语言不足以表达丰富的感情。', '励志');
INSERT INTO `guide_motto` VALUES ('ce9d9bd3cf28474db5dc97a299ac7ba1', '海明威', '今天只是未来生命中的一天，但你的未来却取决于你今天做了什么。', '励志');
INSERT INTO `guide_motto` VALUES ('d35e7bd9b04e435599e8ef9a922fc7cb', '福尔斯特', '即将来临的一天，比过去的一年更为悠长。', '励志');
INSERT INTO `guide_motto` VALUES ('e5986c6d2129461e88f391a7cbac4f58', '车尔尼雪夫斯基', '实践，是个伟大的揭发者，它暴露一切欺人和自欺。', '励志');
INSERT INTO `guide_motto` VALUES ('ee64867dcb574448987d3266d9ea163d', '佚名', '希望象发芽的种子，在你心头充满春意；希望是甜蜜的，她象母亲怀抱中的婴儿，充满了生命的活力。', '励志');
